import React from 'react'
import { MAP_CARDS } from '../utils/Helper'

const MapCards = () => {
  return (
    <div className='container mx-auto py-11'>
      <div className='flex flex-wrap flex-row -mx-3 justify-center'>
        {MAP_CARDS.map((obj, index) => (
          <div key={index} className='w-[33.33%] px-3 lg:mt-0 mt-4 flex justify-center'>
            <div className='max-w-[365px] h-[273px] duration-700 w-full rounded-[22px] py-5 px-7 bg-blue'>
              <img src={obj.icon} alt="svg" />
              <h2 className='font-inter font-semibold text-2xl pt-8 pb-4'>{obj.heading}</h2>
              <p className='font-inter font-light text-base text-black max-w-[304px]'>{obj.paragraph}</p>
              {/* {obj.content.map((items, ideals) => (
                <div key={ideals}>
                  <p className='font-normal text-base text-black'>{obj.list}</p>
                </div>
              ))} */}
            </div>
          </div>

        ))}
      </div>
    </div>
  )
}

export default MapCards
